//     <Card
//       imgsrc={value.imgsrc}
//       title={value.title}
//       series={value.series}
//       link={value.link}
//     />
//   );
// }

ReactDOM.render(
  <>
    <h1 className="heading_style">LIST OF TOP 5 NETFLIX SERIES</h1>
    {SeriesData.map(function ncard(i) {
      return (
        <Card
          imgsrc={i.imgsrc}
          title={i.title}
          series={i.series}
          link={i.link}
        />
      );
    })}
  </>,
  document.getElementById("root")
);
